    },
    {
        title: 'Automatización',
        caption: 'Automatizamos el monitoreo de la seguridad de los alimentos, la seguridad de la farmacia, la calidad del producto y el mantenimiento preventivo de los equipos'
    },
    {
        title: 'Aliado',
        caption: 'Con iOT3K la tecnología se vuelve su aliado imprescindible.'
    },
    {
        title: 'Calidad',
        caption: 'CAMBIAMOS LA FORMA EN LA QUE LAS ORGANIZACIONES ENCOFOCAN EL CUMPLIMIENTO, LA CALIDAD Y LA EFICIENCIA'
    },
]

export const SolutionsArray = [
    {
        title: 'Servicios de comida',
        solutions: [
            {
                image: 'assets/icons/fork.png',
                title: 'Restaurantes',
                caption: 'Asegure la consistencia, el cumplimiento y el control de calidad en su restaurante desde el momento en que los productos alimenticios se reciben a través del almacenamiento, manejo, preparación y servicio. ',
                background: 'restaurants',
            },
            {
                image: 'assets/icons/agronomy.png',
                title: 'Producción de Alimentos',
                caption: 'Mejore el control de calidad y el cumplimiento normativo con acceso oportuno a registros ambientales, informes integrados y alertas procesables. ',
                background: 'food',
            },
            {
                image: 'assets/icons/thermometer.png',
                title: 'Hospitalidad',
                caption: 'Detecta proactivamente las excursiones de temperatura a lo largo de su operación de Alimentos y Bebidas. Administre de manera eficiente el registro de cumplimiento de HACCP y los flujos de trabajo de administración de incidentes. ',
                background: 'hospitality',
            },
        ]
    },
    {
        title: 'Servicios de Salud',
        solutions: [
            {
                image: 'assets/icons/syringe.png',
                title: 'Farmacias',
                caption: 'Utilice el monitoreo remoto y las tecnologías conectadas para garantizar el cumplimiento y mantener la seguridad y eficacia de las vacunas y los medicamentos. ',
                background: 'drug',
            },
            {
                image: 'assets/icons/hospital.png',
                title: 'Hospitales',
                caption: 'Monitoreo de temperatura y presión de salas quirúrgicas y salas limpias. Asegúrese de que las unidades nutricionales solo sirven comidas de la más alta calidad. ',
                background: 'hospital',
            },
            {
                image: 'assets/icons/flask.png',
                title: 'Laboratorios',
                caption: 'Monitoree los ambientes criogénicos para detectar excursiones de temperatura y eliminar la pérdida de muestras de investigación, sangre y otros materiales científicos invaluables. ',
                background: 'labs',
            },
        ]
    },
    {
        title: 'Servicios de Retail',
        solutions: [
            {
                image: 'assets/icons/shopping-cart.png',
                title: 'Supermercados',
                caption: 'Asegure la consistencia, el cumplimiento y el control de calidad en su establecimiento de venta minorista de alimentos desde el momento en que los productos se reciben a través del almacenamiento, manejo y compra. ',
                background: 'market',
            },
            {
                image: 'assets/icons/groceries.png',
                title: 'Tiendas de conveniencia',
                caption: 'Mantenga la consistencia, el cumplimiento y el control de calidad en su establecimiento de alimentos desde el momento en que los productos se reciben a través del almacenamiento, manejo, preparación y compra. ',
                background: 'store',
            },
        ]
    },
]

export const characteristicsArray = [
    {
        image: 'assets/icons/thermometer.png',
        text: 'Temparatura en tiempo real',
    },
    {
        image: 'assets/icons/24-hours.png',
        text: 'Reporte automático cada 24 horas',
    },
    {
        image: 'assets/icons/file.png',
        text: 'Reportes en formato PDF',
    },
    {
        image: 'assets/icons/schedule.png',
        text: 'Reporte según demanda (mensual)',
    },
    {
        image: 'assets/icons/danger.png',
        text: 'Alertas por fallo de red eléctrica, por fallo en comunicación y alerta por parámetro fuera de rango',
    },
    {
        image: 'assets/icons/smartphone.png',
        text: 'Alertas por SMS, correo y llamadas',
    },
]

export const PlatformArray = [
    {
        title: 'Información',
        img: 'assets/icons/information.png',
        text: 'Gracias a los datos recolectados y almacenados en la nube del comportamiento de sus productos, puede tomar acciones preventivas, garantizando la eficacia final de su precio. ',
    },
    {
        title: 'Reportes automáticos',
        img: 'assets/icons/report.png',
        text: 'Capaz de programar a varios correos electrónicos informes diaros en PDF, para reemplazar los registros de temperatura en papel, esto le permite identificar los equipos refrigerados con falla crónica y detectar los sitios de mayor riesgo. ',
    },
    {
        title: 'Visibilidad y Responsabilidad',
        img: 'assets/icons/sms.png',
        text: 'Alerta por mensaje de texto (SMS) a varios celulares de forma inmediata, dando la transparencia necesaria para ejercer un control estrico y riguroso del cuidado y manipulación del producto. ',
    },
    {
        title: 'Monitoreo, trabajo en conjunto',
        img: 'assets/icons/dashboard.png',
        text: 'Gracias a estas herramientas, puede proveer a su equipo de trabajo, un plan de contingencia, asignando acciones correctivas en conjunto para la gestión de accidentes. Con estas medidas asegura la integridad del producto almacenado. ',
    },
]

